    { id: 8, name: "Oakley Plantaris", price: 59.90, image: "https://assets2.oakley.com/cdn-record-files-pi/468817a6-9159-4d56-9666-b0c4004f18da/96dde08c-a2a0-4ddf-b419-b18701716b36/0OO9437__943701__P21__shad__qt.png" }
  ]);

  return (
<div className="home-page">
      <h1>V1SION COMPANY</h1>
